import React from "react";
import styled from "styled-components";
const Wrapper = styled.button`
  cursor: pointer;
  width: 321px;
  height: 80px;
  border-radius: 50px;
  background-color: #47d99b;
  color: white;
  font-size: 22px;
  font-weight: bold;
  display: flex;
  justify-content: center;
  align-items: center;
  margin: 0 auto;
`;
function SendBtn() {
  return <Wrapper>김과장에게 문의하기</Wrapper>;
}

export default SendBtn;
